import React from 'react';
import { Link } from '@reach/router';

const LandingPage = () => {

    return (
        <div className="wrapper">
            <header>
                <h1>Planthood </h1>
                <button className="btn btn-warning"><Link style={{ "color": "black" }} to={"/"}>Log In</Link></button>
            </header>
            <div className="landingDisplay"></div>
        </div>
    )
}

export default LandingPage
